// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    event Transfer(address from, address to, uint256 value);

}

contract CryptoToken is IERC20 {


    //Properties
    string public constant name = "CryptoToken";
    string public constant symbol = "CRY";
    uint8 public constant decimals = 3; //Default dos exemplos  sempre 18
    uint256 private totalsupply;
    uint256 private stockGama;
    address private owner;
    address[] private tokenOwners;

    mapping(address => uint256) private addressToBalance;

    modifier isOwner() {
        require(address(msg.sender) == owner, "Sender is not owner!");
        _;
    }

    //Constructor
    constructor() {
        uint256 total = 3000000000;
        totalsupply = total;
        stockGama = total;
        owner = msg.sender;
        addressToBalance[owner] = totalsupply;
        tokenOwners.push(owner);
    }

    //Public Functions
    function totalSupply() public view override returns (uint256) {
        return totalsupply;
    }

    function showStockGama() public view returns(uint256)  {
        return stockGama;
    }

    function balanceOf(address tokenOwner) public view override returns (uint256){
        return addressToBalance[tokenOwner];
    }


    function transfer(address receiver, uint256 quantity) public override returns (bool){
        require(quantity <= addressToBalance[owner],"Insufficient Balance to Transfer");
        addressToBalance[owner] = addressToBalance[owner] - quantity;
        addressToBalance[receiver] = addressToBalance[receiver] + quantity;
        tokenOwners.push(receiver);
        stockGama = stockGama - quantity;
        emit Transfer(owner, receiver, quantity);
        return true;
    }

    function buy10() public payable{
        require(msg.value == 1 ether);
        require(balanceOf(owner) >= 10, "Not enough Gamas in stock to fulfill purchase request.");
        transfer(msg.sender, 10);
        emit Transfer(address(this), msg.sender, 10);
    }

    function buy20() public payable{
        require(msg.value == 2 ether);
        require(balanceOf(owner) >= 20, "Not enough Gamas in stock to fulfill purchase request.");
        transfer(msg.sender, 20);
        emit Transfer(address(this), msg.sender, 20);
    }


    function sell10() public{
        uint256 valueToPay;
        valueToPay = 10*900000000000000000;
        require(balanceOf(msg.sender) >= 10, "Not enough Gamas to trade for ether.");
        require(owner.balance >= valueToPay, "Not enough ethers to pay for this transaction.");
        payable(msg.sender).transfer(valueToPay);
        emit Transfer(msg.sender, address(this), 10);
    }


}
